<TITLE>Set Background Color</TITLE>
</HEAD>
<SCRIPT>
function setbgcolor(hexvalue) {
	parent.upper.document.bgColor = hexvalue;
	parent.left.document.bgColor = hexvalue;
	parent.right.document.bgColor = hexvalue;
	parent.lower.document.bgColor = hexvalue;
}
</SCRIPT>
